import React from "react";
import * as S from './styles'

import Header from "../../components/Header";
import Footer from '../../components/Footer'
import FilterCard from "../../components/FilterCard";
import { useState } from "react";

function Home() {

    const [filterActive, setFilterActive] = useState();

    return (
        <S.Container>
            <Header />
            <S.FilterArea>
                <FilterCard title="Todos" actived={false} onClick={() => setFilterActive("all")}/>
                <FilterCard title="Hoje" actived={false} onClick={() => setFilterActive("all")}/>
                <FilterCard title="Semana" actived={false} onClick={() => setFilterActive("all")}/>
                <FilterCard title="Mês" actived={false} onClick={() => setFilterActive("all")}/>
                <FilterCard title="Ano" actived={false} onClick={() => setFilterActive("all")}/>
            </S.FilterArea>
            <Footer />
        </S.Container>
    )
}

export default Home;
